// @ts-nocheck
export default async function updateMonthName(t,e,r){try{r.querySelector("#month-name").textContent=new Date(e,t).toLocaleString("default",{month:"long",year:"numeric"})}catch(t){const{default:e}=await import("../../../utils/error-messages/errorLogs.js");throw await e("updateMonthNameError","Update Month Name Error: ",t),t}}